module.exports = {
  parser: '@typescript-eslint/parser',
  plugins: [
    '@typescript-eslint/eslint-plugin',
    'eslint-plugin-tsdoc',
    'eslint-plugin-html',
  ],
  extends: ['plugin:@typescript-eslint/recommended'],
  parserOptions: {
    sourceType: 'module',
  },
  rules: {
    '@typescript-eslint/no-extra-semi': 0,
    '@typescript-eslint/no-explicit-any': 0,
    '@typescript-eslint/no-empty-interface': 0,
    '@typescript-eslint/ban-ts-comment': 0,
    '@typescript-eslint/no-unused-vars': ['error', { varsIgnorePattern: '^_' }],
    '@typescript-eslint/ban-types': 0,
    'tsdoc/syntax': 'warn',
  },
  ignorePatterns: ['dist.*'],
  overrides: [
    {
      files: '*.mjs',
      parser: 'espree',
      env: {
        node: true,
        es6: true,
      },
      parserOptions: {
        ecmaVersion: 2020,
        sourceType: 'module',
      },
      plugins: [],
      extends: 'eslint:recommended',
      rules: {
        'tsdoc/syntax': 0,
      },
    },
    {
      files: ['**/__tests__/**.ts'],
      rules: {
        '@typescript-eslint/no-empty-function': 0,
        '@typescript-eslint/no-non-null-assertion': 0,
      },
    },
    {
      files: '*.vue',
      extends: [
        'plugin:vue/vue3-recommended',
        'eslint:recommended',
        '@vue/typescript/recommended',
        'prettier',
      ],
      globals: {
        defineProps: 'readonly',
        defineEmits: 'readonly',
        defineExpose: 'readonly',
        withDefaults: 'readonly',
      },
    },
  ],
}

import { defineConfig, devices } from '@playwright/test'

export default defineConfig({
  // Look for test files in the "tests" directory, relative to this configuration file.
  testDir: 'e2e',

  // Run all tests in parallel.
  fullyParallel: true,

  // Fail the build on CI if you accidentally left test.only in the source code.
  forbidOnly: !!process.env.CI,

  // Reporter to use
  reporter: 'html',
  use: {
    // Base URL to use in actions like `await page.goto('/')`.
    baseURL: 'http://127.0.0.1:8787',
  },

  // Configure projects for major browsers.
  projects: [
    {
      name: 'chromium',
      use: {
        ...devices['Desktop Chrome'],
        headless: true,
        launchOptions: {
          args: ['--js-flags=--expose-gc'],
        },
      },
    },
  ],

  // Run your local dev server before starting the tests.
  webServer: [
    {
      command: 'pnpm playwright-build && pnpm playwright-server',
      url: 'http://127.0.0.1:8787',
      reuseExistingServer: false,
    },
    {
      command: 'node --expose-gc e2e/servers/formKitMemoryServer.mjs',
      url: 'http://localhost:8686',
      reuseExistingServer: false,
    },
    {
      command: 'node --expose-gc e2e/servers/vueMemoryServer.mjs',
      url: 'http://localhost:8585',
      reuseExistingServer: false,
    },
    // {
    //   command:
    //     'pnpm nuxt-build && NITRO_PORT=8484 node --expose-gc packages/nuxt/playground/.output/server/index.mjs',
    //   url: 'http://localhost:8484',
    //   reuseExistingServer: false,
    // },
  ],
})

const autoprefixer = require('autoprefixer')
const nesting = require('postcss-nesting')

module.exports = {
  plugins: [nesting(), autoprefixer()],
}

import { defineConfig } from 'vitest/config'
import vueJsx from '@vitejs/plugin-vue-jsx'
import { replaceCodePlugin } from 'vite-plugin-replace'

export default defineConfig({
  resolve: {
    conditions: ['development'],
  },
  plugins: [
    vueJsx(),
    replaceCodePlugin({
      replacements: [
        {
          from: '__DEV__',
          to: 'false',
        },
      ],
    }),
  ],
  test: {
    environment: 'jsdom',
    retry: 2,
    // singleThread: true,
    exclude: [
      '**/node_modules/**',
      '**/e2e/**',
      './packages/nuxt/playground/**',
    ],
    typecheck: {
      ignoreSourceErrors: true,
      include: ['./packages/**/?(*.){test,spec}-d.?(c|m)[jt]s?(x)'],
      exclude: [
        '**/node_modules/**',
        '**/examples/**',
        './packages/nuxt/playground/**.ts',
      ],
    },
  },
})
